#include<bits/stdc++.h>
using namespace std;

#define ll long long int
float GPA(float credit, float result)
{
    float CG;
    CG=(float)(result/4)*credit;
    return CG;
}


int main()
{
    float CG, p;
    cout << "You have to enter your GPA out of 4:00." << endl;
    cout << "GPA in Islamic History Science and Culture  : ";
    cin >> CG;
    p+=GPA(2,CG);
     cout << "GPA in Technology, Environment and Society : ";
    cin >> CG;
    p+=GPA(3,CG);
     cout << "GPA in Geometry and Differential Calculus  : ";
    cin >> CG;
    p+=GPA(4,CG);
     cout << "GPA in Physics I : ";
    cin >> CG;
    p+=GPA(3,CG);
     cout << "GPA in Computing for Engineers/SWE  : ";
    cin >> CG;
    p+=GPA(3,CG);
     cout << "GPA in Structured Programming I : ";
    cin >> CG;
    p+=GPA(3,CG);
     cout << "GPA in Arabic I  : ";
    cin >> CG;
    p+=GPA(1,CG);
     cout << "GPA in Physics I Lab : ";
    cin >> CG;
    p+=GPA(0.75,CG);
     cout << "GPA in Structured Programming I Lab : ";
    cin >> CG;
    p+=GPA(1.5,CG);
     cout << "GPA in Engineering Drawing Lab : ";
    cin >> CG;
    p+=GPA(0.75,CG);

    float CGPA=(p/22)*4;
    cout << "Your CGPA in 1st semester is : " << CGPA;

    return 0;
}
